import React from 'react';
import './App.css';
import Title from './components/title/title';
import AppDrawer from './components/app-drawer/appDrawer';
import Drawer from './components/app-drawer/drawer';


function App() {
  return (
    <React.Fragment>
      <AppDrawer />
      <div className="App"><Title/></div>
      <Drawer/>
    </React.Fragment>
  );
}

export default App;
